import * as React from 'react';
import { useTheme } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions } from '@mui/material';
import { BrowserRouter as Router, Switch, 
  Route, Redirect,} from "react-router-dom";


  const theme = createTheme({
    palette: {
      primary: {
      main: "#5B84B1FF"
      },
      secondary: {
      main: "#FC766AFF"
      }
    }
    });


export default function CourseCard() {
  const theme = useTheme();



  
  const routeChange = () =>{ 
    this.context.location.transitionTo('HomePage');
  
  }


  return (
    <Card sx={{ maxWidth: 445,backgroundColor:"#5B84B1FF" }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="140"
          image="https://static.vecteezy.com/system/resources/thumbnails/003/127/954/small/abstract-template-blue-background-white-squares-free-vector.jpg"
          alt="green iguana"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            Software Construction
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Credits 3+1
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="#FC766AFF" href={"/ClMapping"}>
          Grading
        </Button>
        <Button size="small" color="#FC766AFF" href={"/ClMapping"}>
          CLO Mapping
        </Button>
      </CardActions>
    </Card>
  );
}
